package primitives_test

import (
	"encoding/hex"
	"github.com/olympus-protocol/ogen/pkg/primitives"
	testdata "github.com/olympus-protocol/ogen/test"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestBlock(t *testing.T) {
	correct := testdata.FuzzBlock(2, true, true)
	for _, b := range correct {
		ser, err := b.Marshal()
		assert.NoError(t, err)

		desc := new(primitives.Block)
		err = desc.Unmarshal(ser)
		assert.NoError(t, err)

		assert.Equal(t, b, desc)
	}

	incorrect := testdata.FuzzBlock(2, false, true)
	for _, b := range incorrect {
		_, err := b.Marshal()
		assert.NotNil(t, err)

	}

	nilpointers := testdata.FuzzBlock(2, true, false)
	for _, b := range nilpointers {
		assert.NotPanics(t, func() {
			data, err := b.Marshal()
			assert.NoError(t, err)

			n := new(primitives.Block)
			err = n.Unmarshal(data)
			assert.NoError(t, err)

			assert.Equal(t, b, n)

			assert.Equal(t, uint64(0), n.Header.Slot)
		})

	}
}

func TestBlocksMerkle(t *testing.T) {
	// Serialized snappy compressed block
	blockRaw, err := hex.DecodeString("")

	assert.NoError(t, err)

	b := new(primitives.Block)
	err = b.Unmarshal(blockRaw)
	assert.NoError(t, err)

	assert.Equal(t, "10c7c52c17576939715176607bb93ca66d637f55315966bef586ca00e0a56e77", b.VotesMerkleRoot().String())
	assert.Equal(t, "872cd6787bd8a7be9e4a9dc19c3b87d25a61693b3e5c72116592278feb95eb09", b.TransactionMerkleRoot().String())
	assert.Equal(t, "fb1fd8524123594253936b96be1ab97e620a0a9be66f30a3b1aae603c7096f0f", b.TransactionMultiMerkleRoot().String())
	assert.Equal(t, "c78ddb8361e7070824f72f49e793b7898ac156fe498f0e1cb7aac2c2862f1d1f", b.DepositMerkleRoot().String())
	assert.Equal(t, "a86af30e842279f128b5f31fa942fda2cbd7ab282eb83f87a5d1eb93893ebec2", b.ExitMerkleRoot().String())
	assert.Equal(t, "2d88bf99585a433c7f5cd0af496033df85ec9390970dd72375a1d293dcaa7695", b.VoteSlashingRoot().String())
	assert.Equal(t, "38bb67077995a1c4524388913d24c74516e8a4254f2bc20732809c1b5d440d4c", b.RANDAOSlashingsRoot().String())
	assert.Equal(t, "d0acd430a6779c43bc4c1e1da8731852dd73454b152ec5403f5f7ec0c2bb3577", b.ProposerSlashingsRoot().String())
	assert.Equal(t, "e1c0d17f4a0c6000ecee31b3eafd6d24273852a73ebeb55fd2f0fec3c4c56ad9", b.GovernanceVoteMerkleRoot().String())
	assert.Equal(t, "1434f190f588f33718051153c949760dd1ce2989bbec05a8f9762a060e5b473e", b.CoinProofsMerkleRoot().String())
	assert.Equal(t, "725ca84aa3c77308e11fe8914b6087513880acc543bb870e4e3e9eb6f0605bcb", b.PartialExitsMerkleRoot().String())
	assert.Equal(t, "c815cddecaa4393a98df3a3c58b387ef6d5e6efaecf1e64b92e17b607f3fe958", b.ExecutionsMerkleRoot().String())

	expectedTx := []string{"23e351e9beff70c406f95b230387c6febe028728cc076a4c0f9f82c2c5bb011a", "9e4417e6f5fdb6592117c903d6344294bf72516d25615339f4a99bde0044ae86"}
	txs := b.GetTxs()

	assert.Equal(t, expectedTx, txs)
}
